import React from 'react';
import AddProductForm from '../components/AddProductForm';
import ProductList from '../components/ProductList';

const ProductsPage = () => (
    <div>
        <h2> Products</h2>
        <AddProductForm />
        <ProductList />
    </div>
);

export default ProductsPage;
